import React from "react";

export default function Navigation() {
  const linkStyle = {
    border: "1px black",
    padding: "20px",
  };

  return (
    <nav className="main-header-menu">
      <section className="header">
        <div style={linkStyle}>
          <a href="#about">ABOUT</a>
        </div>
        <div style={linkStyle}>
          <a href="#portfolio">PORTFOLIO</a>
        </div>
        <div style={linkStyle}>
          <a href="">RESUME</a>
        </div>
        <div style={linkStyle}>
          <a href="#contact">CONTACT</a>
        </div>
      </section>
    </nav>
  );
}
